import React, { Component } from "react";
// import Background from
import "./Home.css";

export default class Home extends Component {
  render() {
    return (
      <div className="background">
        <div className="welcome">
          <div class="box">
            <span class="span1">B</span>
            <span class="span2">E</span>
            <span class="span3">M</span>
            <span class="span4">-</span>
            <span class="span5">V</span>
            <span class="span6">I</span>
            <span class="span7">N</span>
            <span class="span8">D</span>
            <span class="span9">O</span>
          </div>
        </div>
      </div>
    );
  }
}
